import React from "react";
import { useState, userRef } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import "./Calendar.css";

function CalendarAddPop() {
  let defaultSettings = {
    calTitle: "일정등록",
    calConfirmBtn: "확인",
    calScheduleTitle: "일정명",
    startDateTitle: "시작",
    endDateTitle: "종료",
    attendenceTitle: "참석자",
    display: "false",
  };
  const [scheduleTitle, setScheduleTitle] = userState("");
  const [startDate, setStartDate] = userState("");
  const [startTime, setStartTime] = userState("");
  const [endDate, setEndDate] = userState("");
  const [endTime, setEndTime] = userState("");
  const [attendence, setAttendence] = userState("");
  const [contents, setContents] = userState("");

  const onChageSchedule = (e) => {
    setScheduleTitle();
  };
  const onChageStartDate = (e) => {
    setStartDate();
  };
  const onChageStartTime = (e) => {
    setStartTime();
  };
  const onChageEndDate = (e) => {
    setEndDate();
  };
  const onChageEndTime = (e) => {
    setEndTime();
  };
  const onChageAttendence = (e) => {
    setAttendence();
  };
  const onChageContents = (e) => {
    setContents();
  };

  //Input값 Change 이벤트 함수

  const addSchedule = (e) => {
    let baseUrl = "/calendar/add/schedule";

    //validate조건이 true일 경우에 axios통신을 한다.
    // if (validate() == true) {
    axios.post(baseUrl, {
      title: scheduleTitle, //스케줄 제목
      contents: contents, //스케줄 내용
      writer: "tykim", //세션유저를 사용할예정
      userid: "", //세션유저를 사용할 예정
      attendence: attendence,
      startDate: startDate + startTime,
      endDate: endDate + endTime,
    });
    console.log("일정을 등록하였습니다.");
    // }
  };

  //일정등록시 필요한 Validate 함수
  const validate = () => {
    let codeType = true;
    if (scheduleTitle === "") {
      console.log("scheduleTitle 값을 입력 해주세요.");
      codeType = false;
    } else if (startDate === "") {
      console.log("startDate 값을 입력 해주세요.");
      codeType = false;
    } else if (startTime === "") {
      console.log("startTime 값을 입력 해주세요.");
      codeType = false;
    } else if (endDate === "") {
      console.log("endDate 값을 입력 해주세요.");
      codeType = false;
    } else if (endTime === "") {
      console.log("endTime 값을 입력 해주세요.");
      codeType = false;
    } else if (attendence === "") {
      console.log("attendence 값을 입력 해주세요.");
      codeType = false;
    } else if (contents === "") {
      console.log("contents 값을 입력 해주세요.");
      codeType = false;
    }
    return codeType;
  };
  return (
    <div className="calendar_add_box">
      <div className="cal_add_header">
        <div className="menu_bar">
          <Link to="/Calendar">
            <div className="cal_add_ico_cancel">X</div>
          </Link>
          <div className="menu_title">{defaultSettings.calTitle}</div>
          <div className="cal_add_confirm_btn" onClick={addSchedule}>
            {defaultSettings.calConfirmBtn}
          </div>
        </div>
      </div>
      <div className="cal_add_body">
        <div className="schedule_name">
          <div className="sch_title">{defaultSettings.calScheduleTitle}</div>
          <div className="sch_input_txt">
            <input name="scheduleTitle" type="text" onChange={onChage}></input>
          </div>
        </div>
        <div className="shcedule_start">
          <div className="sch_st_title">{defaultSettings.startDateTitle}</div>
          <div className="start_date">
            <input name="startDate" type="date" onChange={onChage}></input>
          </div>
          <div className="start_time">
            <input name="startTime" type="time" onChange={onChage}></input>
          </div>
        </div>
        <div className="shcedule_end">
          <div className="sch_ed_title">{defaultSettings.endDateTitle}</div>
          <div className="end_date">
            <input name="endDate" type="date" onChange={onChage}></input>
          </div>
          <div className="end_time">
            <input name="endTime" type="time" onChange={onChage}></input>
          </div>
        </div>
        <div className="shcedule_attendence">
          <div className="sch_atd_title">{defaultSettings.attendenceTitle}</div>
          <div className="attendence_name">
            <input name="attendence" type="text" onChange={onChage}></input>
          </div>
        </div>
        <div className="shcedule_contents">
          <div className="shcedule_txtarea">
            <textarea
              name="contents"
              placeholder="내용을 입력하세요."
              onChange={onChage}
            ></textarea>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CalendarAddPop;
